import  json, lzma, base64
import pandas as pd


# Pfam data index - Conserved domains
Pfam_table = """

"""
pfam_index_compressed = base64.b64decode(Pfam_table)
pfam_index = lzma.decompress(pfam_index_compressed)

Pfam_description = """

"""
pfam_description_compressed = base64.b64decode(Pfam_description)
pfam_description_json = lzma.decompress(pfam_description_compressed)

# load json index Pfam
pfam_info = json.loads(pfam_index)
pfam_metadata = pd.DataFrame(pfam_info)
# load json index Pfam
pfam_desc = json.loads(pfam_description_json)
pfam_complete_desc = pd.DataFrame(pfam_desc)

